import React , {Component} from "react";
class GitTracker extends Component{
    render(){
        return(
          <div className="container">
              <div class="row">
                  <div className="col-12">
                  Housing
                  </div>
              </div>
              <div class="row">
                  <div className="col-12">
                  Enteratment
                  </div>
              </div>
              <div class="row">
                  <div className="col-12">
                  Repair and Maintenance
                  </div>
              </div>
              <div class="row">
                  <div className="col-12">
                  Electricity and Water fees
                  </div>
              </div>
          </div>
        );
    }
}

export default GitTracker;
